import React, { Component } from 'react';

export interface IUrl {
    url: {
        res: string,
        url: string,
    }[]
}

const UrlBody = (urls: IUrl) => {
    const rows = urls.url.map((row, index) => {
        return (
            <a href={row.url} rel="nofollow" target="_blank">{row.res}</a>
        )
    })
    return (
        <div className="mt-3 d-flex justify-content-center dropdown show">
            <a className="btn btn-success dropdown-toggle" href="#" role="button" id="dropdownMenuLink" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                Resoltion
            </a>
            <div className="dropdown-menu" aria-labelledby="dropdownMenuLink">{rows}</div>
        </div>

    )
};

export default UrlBody;
